import React from "react";
import "./searchBar.scss";

import { FaSearch } from "react-icons/fa";

const SearchBar = () => (
  <div className="search">
    <div className="search-group">
        <FaSearch />
      <input type="text" placeholder="search" />
    </div>
  </div>
);

export default SearchBar;
